                    call.typeHash,
                    activator,
                    call.to,
                    call.value,
                    targetNonce,
                    call.metaData.staticcall,
                    call.metaData.gasLimit,
                    keccak256(call.data)
                )
                : abi.encode(
                    call.typeHash,
                    activator,
                    call.to,
                    call.value,
                    targetNonce,
                    call.metaData.staticcall,
                    call.metaData.gasLimit,
                    _selector(call.data),
                    call.data[4:]
                );
    }

