                        call.typeHash != bytes32(0)
                    ),
                    call.v2,
                    call.r2,
                    call.s2
                );
                require(signer1 == s_owner, "Wallet: signer1 is not owner");
                require(
                    signer2 == activator,
                    "Wallet: signer2 is not activator"
                );
                require(
                    call.to != signer1 &&
                        call.to != signer2 &&
                        call.to != address(this) &&
